 Mausklicks durchzuf\xFChren. z.B. das Abspielen eines Videos f\xFChrt in Wahrheit zu einem "Like" auf Facebook ohne dass es der Nutzer merkt.',Kab='<b>3.<\/b> Nutze die Personensuchmaschinen um peinliche oder l\xE4ngst vergessen Sachen deiner Freunde zu finden. ',Q8='<b>Google Hits<\/b>:',Hab='<br/>',Wab='<br><center><a target="_blank" href="deinstall.png"><img style="height:200px" src="deinstall.png"><\/a><\/center>',Cab='<br><span style="font-size:2em">1.<\/span><b> Deaktiviere "\xF6ffentliche Suche" in Facebook<\/b>: Ein <img src="good.png" width="20px">-Smile neben deinem Namen bedeutet, dass  du die "\xF6ffentliche Suche" Option in Facebook <a target="_blank" href="">deaktiviert <br>hast.<\/a> Wenn ein <img src="bad.png" width="20px">-Smile neben deinem Namen ist, dann ist dein Profile mit Google auffindbar. Falls du nicht mit Google gefunden werden musst, solltest du diese Voreinstellung <b>dringend \xE4ndern:<\/b> <br><center><a target="_blank" href="/noPubSearch.png"><img style="height:200px" src="/noPubSearch.png"><\/a><\/center><br>("\xD6ffentliche Suche" ist eine Option in Facebook, die seit Nov. 2009 bei allen Nutzern zwanghaft aktiviert wurde. Kaum einer <br>hat die Option abgestellt. Die Folge war, dass <a target="_blank" href="http://www.heise.de/newsticker/meldung/Facebook-Crawler-sammelt-mehr-als-170-Millionen-Datensaetze-1046712.html">170 Millionen Datens\xE4tze<\/a> (ca. 50% der Facebook Mitglieder) von Facebook abgegriffen wurden.) <br>',o7='<gwt:clipper style="',Bab='<hr>',f7="<img onload='this.__gwtLastUnhandledEvent=\"load\";' src='",zab='<img src="ajax-loader.gif">',Y8='<img src="bad.png" width="15px"> Folgende Freunde kommen in deiner Freundesliste doppelt vor, bist du vielleicht ein Opfer von <a target="_blank" href="http://de.wikipedia.org/wiki/Identit%C3%A4tsdiebstahl">Identit\xE4tsdiebstahl<\/a>.',_8='<img src="good.png" width="15px"> Keine doppelten Freunde <a target="_blank" href="http://de.wikipedia.org/wiki/Identit%C3%A4tsdiebstahl">(Identit\xE4tsdiebstahl)<\/a> in deiner Freundesliste gefunden.',x8='<img width="15px" src="/bad.png"><\/img>',u8='<img width="15px" src="/good.png"><\/img>',J8='<img width="20px" src="/bad.png"><\/img>',I8='<img width="20px" src="/good.png"><\/img>',Aab='<span style="font-size:1.6em">Can You Be Googled? - Finde es heraus in 5 Schritten!<\/span> <br>',Lab='<span style="font-size:2em">(3.)<\/span> <b>Google alle deine Freunde auf einen Schlag<\/b>: \xDCberspringe diesen Punkt, falls du nicht mindestens 5 Minuten Zeit investieren kannst, keinen Google Account besitzt oder nicht bereit bist dir schnell einen zu erstellen. Wenn du deine Freunde <b> alle<\/b> auf einen Schlag googlen willst, so wie ich dein Profil oben gegoogelt habe, dann musst du Folgendes tun: Log dich in einen Google Account ein (Erstellen dauert ein, zwei Minuten). Hole dir einen Google Suchschl\xFCssel, den es <a  target="_blank" href="https://code.google.com/apis/console/?pli=1">hier<\/a> gibt. Befolge einfach diesen <a  target="_blank" href="apiToken.png">Screenshot<\/a>. Gib ihn in die Box unten ein und dr\xFCcke auf "Go!". <br>Der Grund f\xFCr dieses Vorgehen ist, dass ein Google Konto begrenzt viele Anfragen pro Tag frei zur Verf\xFCgung hat. Da ich diese App werbefrei halten will, mache ich das so.) Ich speichere deinen Key nicht und verwende ihn <b>nur<\/b> f\xFCr die Suche in diesem Browserfenster. So sieht das dann aus: <a href="/2prev.png" target="_blank">Beispiel<\/a>.',Eab='<span style="font-size:2em">2.<\/span> <b>Hilf deinen Freunden<\/b>: ',Vab='<span style="font-size:2em">4.<\/span> <b>Gefahren, die von Facebook Apps ausgehen<\/b>: Bitte <span style="color:red;"><b>installiere NIE WIEDER Facebook Apps<\/b><\/span>! Deinstalliere bitte ALLE Apps, auch diese hier. JEDE Facebook App kann <a href="http://www.clickjacked.org/2011/06/you-shall-not-trust-facebook.html" target="_blank">deinen Facebook Account gef\xE4hrden<\/a>.Da du diese App installiert hast, kannst du sie dir auch anschauen (wenn die App deine Pinnwand vollspammen wollen w\xFCrde, w\xE4re das JETZT bereits geschehn :D). Das ist die erste <b>virale Facebook Security App<\/b>. Viral bedeutet, es funktioniert wie der ganze Spam da drau\xDFen, macht aber etwas N\xFCtzliches. :) ',Xab='<span style="font-size:2em">5.<\/span> Investiere wenige Minuten und lerne auf meinem Blog <a  target="_blank" href="http://www.clickjacked.org/2011/07/secure-your-facebook-account-in-only-18.html"><b>wie<\/b> du dein Facebook Profil sichern<\/a> kannst. ',v3='=',t3='?',d9='?viewas=100000686899395">Show<\/a>',X1='@',E5='A DisclosurePanel can only contain two Widgets.',$2='A request timeout has expired after ',vab='About',Fdb='AbsolutePanel',qeb='AbstractCollection',Cfb='AbstractHashMap',Efb='AbstractHashMap$EntrySet',Ffb='AbstractHashMap$EntrySetIterator',Hfb='AbstractHashMap$MapEntryNull',Ifb='AbstractHashMap$MapEntryString',reb='AbstractList',Jfb='AbstractList$IteratorImpl',Kfb='AbstractList$ListIteratorImpl',Bfb='AbstractMap',Lfb='AbstractMap$1',Mfb='AbstractMap$1$1',Gfb='AbstractMapEntry',Ocb='AbstractRenderer',Nfb='AbstractSequentialList',Vcb='AbstractSerializationStream',Wcb='AbstractSerializationStreamReader',Xcb='AbstractSerializationStreamWriter',Dfb='AbstractSet',P7='Add not supported on this collection',W7='Add not supported on this list',Uab='Alle Google Hits meiner Freunde ausklappen',Sab='Alle Likes ein/ausklappen ',C2='An event type',p9='An meine Pinnwand posten',nbb='Animation',afb='ArithmeticException',seb='ArrayList',cfb='ArrayStoreException',Ofb='Arrays$ArrayList',Gdb='AttachDetachException',Hdb='AttachDetachException$1',Idb='AttachDetachException$2',Bcb='AutoDirectionHandler',X4='BOOLEAN',$4='BYTE',s2='BackgroundImageCache',teb='BaseListenerWrapper',dcb='BeforeSelectionEvent',gbb='Book',dfb='Boolean',Ldb='Button',Kdb='ButtonBase',ffb='Byte',gfb='Byte;',N6='CENTER',_4='CHAR',A2='CM',Y7="Can't get element ",Y1="Can't overwrite cause",Z7="Can't remove element ",H2='Cannot add a handler wi
